import React from 'react';
import { BrowserRouter, Route, Routes } from "react-router-dom";

import './index.scss';
import Report from './pages/report/Report';

function App() {
    return (
      <BrowserRouter>
        <Routes>
            <Route path="/" element={<Report/>} />
        </Routes>
       </BrowserRouter>
    );
  }

  export default App;
